import React from 'react';
import { View } from 'react-native';

export default () => {
  return (
    <View
      style={{
        flex: 1,
        height: 0.5,
        width: '92%',
        backgroundColor: '#e4e4e4',
        marginLeft: 'auto',
        marginRight: 'auto',
      }}
    />
  );
};
